import React from 'react';

class Sites extends React.Component{
    render(){
        let sites = this.props.sites;
        let sites_text = '';
        switch (sites) {
            case '0':
                sites_text = '0';
                break;
            default:
                sites_text = 'OFF';
                break;
        }
        return (
            <div>{this.props.sites}</div>
        )
    }
}



export default Sites;
